import React from 'react'
import './Category.css';
import { ShopCategory } from '../Assets/all_product'
import { CategoryCard } from './CategoryCard';

export const Category = () => {
  return (
    <div id="categories">
        <div className="title">
            <h2>Categories</h2>
        </div>
        <div className="categories-container container">
            {
                ShopCategory.map((category) => {
                    <CategoryCard key={category.thumbnail} {...category}/>
                })
            }
            <img src={require('../Assets/hero4.png')}></img>
        </div>

    </div>
  )
}
